  false,\n\t\"url\": null,\n\t\"notes\": \"This report is on the 2007 prairie dog
  population density estimates and monitoring for Lacreek National Wildlife Refuge.
  Monitoring of prairie dog habitats is essential to ensuring that we are providing
  that short grass habitat, but also that there are medium and tall grass habitats
  provided in upland areas as well for those wildlife species that require those habitats.
  Additionally, monitoring densities of prairie dogs is important to insure that we
  are maintaining a viable population on the refuge.  This report includes maps of
  prairie dog town locations and data from 2007.\",\n\t\"license_title\": \"License
